Custom sections allow embedding named arbitrary data into a wasm module. The section data is set at compile time and is read directly from the wasm module, it cannot be modified at runtime. In Rust, custom sections are static arrays ([T; size]) exposed with the #[link_section] attribute: #[link_section = "hello"]
