이전 장에서 초기 프로젝트 템플릿을 복제했습니다. 이제 해당 프로젝트 템플릿을 사용할 것입니다. wasm-game-of-life/src/lib.rs에서 alert 가져오기 및 greet 기능을 제거하고 셀과 관련된 자료형들을 정의하는 것으로 시작하겠습니다. #[wasm_bindgen]
#[repr(u8)]
#[derive(Clone, Copy, Debug, PartialEq, Eq)]
pub enum Cell { Dead = 0, Alive = 1,
} 각 셀이 단일 바이트로 표시되도록 #[repr(u8)]이 있는 것이 중요합니다. Dead는 0이고 Alive는 1에 대응된다는 것도 중요하므로 덧셈을 통해 셀의 살아있는 이웃을 쉽게 계산할 수 있습니다. 다음으로, 우주를 정의합시다. 우주에는 너비와 높이가 있고 길이가 width * height인 셀의 벡터가 있습니다. #[wasm_bindgen]
pub struct Universe { width: u32, height: u32, cells: Vec<Cell>,
} 주어진 행과 열에 있는 셀에 액세스하려면 앞에서 설명한 대로 행과 열을 인덱스로 변환하여 셀 벡터로 변환합니다. impl Universe { fn get_index(&self, row: u32, column: u32) -> usize { (row * self.width + column) as usize } // ...
} 세포의 다음 상태를 계산하기 위해 우리는 얼마나 많은 이웃이 살아 있는지 세어야 합니다. 그렇게 하기 위해 live_neighbor_count 메소드를 작성해 봅시다! impl Universe { // ... fn live_neighbor_count(&self, row: u32, column: u32) -> u8 { let mut count = 0; for delta_row in [self.height - 1, 0, 1].iter().cloned() { for delta_col in [self.width - 1, 0, 1].iter().cloned() { if delta_row == 0 && delta_col == 0 { continue; } let neighbor_row = (row + delta_row) % self.height; let neighbor_col = (column + delta_col) % self.width; let idx = self.get_index(neighbor_row, neighbor_col); count += self.cells[idx] as u8; } } count }
} live_neighbor_count 매소드는 변화와 나머지 연산을 사용하여 if문을 통해 우주의 가장자리를 특수 케이스로 사용하는 것을 방지합니다. 변화량 -1을 적용할 때 self.height - 1을 더합니다. 1을 빼는 것을 나머지 연산이 대체하도록 합니다. row와 column은 0이 될 수 있는데, 여기서 1을 빼려고 하면 unsigned integer underflow가 발생합니다. 이제 현재 세대에서 다음 세대를 계산하는 데 필요한 모든 것이 있습니다! 게임의 각 규칙은 match 표현식에 대한 조건으로의 직접적인 번역을 따릅니다. 또한 JavaScript가 틱이 발생하는 시점을 제어하기를 원하기 때문에 이 메소드를 #[wasm_bindgen] 블록 안에 넣어 JavaScript에 노출되도록 할 것입니다. /// JavaScript로 내보낼 Public methods.
#[wasm_bindgen]
impl Universe { pub fn tick(&mut self) { let mut next = self.cells.clone(); for row in 0..self.height { for col in 0..self.width { let idx = self.get_index(row, col); let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); let next_cell = match (cell, live_neighbors) { // 규칙 1: 살아있는 이웃이 2개 미만인 살아있는 세포는 // 마치 인구 부족으로 인한 것처럼 죽습니다. (Cell::Alive, x) if x < 2 => Cell::Dead, // 규칙 2: 살아있는 이웃이 2~3개 있는 살아있는 세포는 // 다음 세대에 계속 살아갑니다. (Cell::Alive, 2) | (Cell::Alive, 3) => Cell::Alive, // 규칙 3: 살아있는 이웃이 세 개 이상 있는 살아있는 // 세포는 마치 인구 과잉으로 인해 죽는 것처럼 보입니다. (Cell::Alive, x) if x > 3 => Cell::Dead, // 규칙 4: 정확히 3개의 살아있는 이웃이 있는 죽은 세포는 // 마치 번식에 의한 것처럼 살아있는 세포가 됩니다. (Cell::Dead, 3) => Cell::Alive, // 다른 모든 셀은 동일한 상태로 유지됩니다. (otherwise, _) => otherwise, }; next[idx] = next_cell; } } self.cells = next; } // ...
} 지금까지 우주의 상태는 세포의 벡터로 표현되었습니다. 사람이 읽을 수 있도록 기본 텍스트 렌더러를 구현해 보겠습니다. 아이디어는 우주를 한 줄씩 텍스트로 작성하고 살아 있는 각 셀에 대해 유니코드 문자 ◼("검정색 중간 정사각형")를 인쇄하는 것입니다. 죽은 세포의 경우 ◻("흰색 중간 정사각형")를 인쇄합니다. Rust의 표준 라이브러리에서 Display 트레잇을 구현함으로써 우리는 사용자가 보는 방식으로 구조를 설정하는 방법을 추가할 수 있습니다. 이것은 또한 자동으로 to_string 메서드를 제공합니다. use std::fmt; impl fmt::Display for Universe { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { for line in self.cells.as_slice().chunks(self.width as usize) { for &cell in line { let symbol = if cell == Cell::Dead { '◻' } else { '◼' }; write!(f, "{}", symbol)?; } write!(f, "\n")?; } Ok(()) }
} 마지막으로 살아있는 세포와 죽은 세포의 흥미로운 패턴과 'render' 메서드로 우주를 초기화하는 생성자를 정의합니다. /// JavaScript로 내보낼 Public methods.
#[wasm_bindgen]
impl Universe { // ... pub fn new() -> Universe { let width = 64; let height = 64; let cells = (0..width * height) .map(|i| { if i % 2 == 0 || i % 7 == 0 { Cell::Alive } else { Cell::Dead } }) .collect(); Universe { width, height, cells, } } pub fn render(&self) -> String { self.to_string() }
} 이것으로 Game of Life 구현의 Rust 부분의 절반이 완료되었습니다! wasm-game-of-life 디렉토리 내에서 wasm-pack build를 실행하여 WebAssembly로 다시 컴파일하십시오.

